import React, { useState, useEffect } from 'react'
import Typography from '@mui/material/Typography'
import Grid from '@mui/material/Grid'
import RenderTextField from './RenderTextField'
import DateSelection from './DateSelection'

const StnMetaInput = (props) => { 

  const [metastate, setMetastate] = useState({
    sids: '',
    county: '',
    climdiv: '',
    cwa: '',
    basin: '',
    state: '',
    bbox: '',
    sdate: '',
    edate: '',
    date: '',
    meta: '',
    elems: '',
    output: '',
    network: '',
  })

  const updateHelpFor = (helpFor) => {
    props.updateHelpFor(helpFor)
  }

  const updateParam = (update) => {
    setMetastate({...metastate, ...update})
    props.updateInputParams(update)
  }

//  shouldComponentUpdate = (nextProps, nextState) => {
//////   this.metafields = Object.keys(metastate)
//    if (this.state !== nextState) {
//      return true
//    } else if (props !== nextProps) {
//      return this.metafields.some((key) => (nextProps.input_params.hasOwnProperty(key) && this.state[key] !== nextProps.input_params[key]) ||
//            (!nextProps.input_params.hasOwnProperty(key) && this.state[key] !== ''))
//    } else {
//      return false
//    }
//  }
  useEffect(() => {
    let newmeta = {}
    Object.keys(metastate).forEach((key) => {
      if (props.input_params.hasOwnProperty(key) && metastate[key] !== props.input_params[key]) {
        newmeta = ({...newmeta, ...{[key]: props.input_params[key]}})
      } else if (!props.input_params.hasOwnProperty(key) && metastate[key] !== '') {
        newmeta = ({...newmeta, ...{[key]: ''}})
      }
    })
    if (Object.keys(newmeta).length) {
      setMetastate(newmeta)
    }
  },[props.input_params])

//  componentDidUpdate = (prevProps) => {
//    if (props.input_params !== prevProps.input_params) {
//      Object.keys(metastate).forEach((key) => {
//        if (props.input_params.hasOwnProperty(key) && this.state[key] !== props.input_params[key]) {
//          this.setState({[key]: props.input_params[key]})
//        } else if (!props.input_params.hasOwnProperty(key) && this.state[key] !== '') {
//          this.setState({[key]: ''})
//        }
//      })
//    }
//  }


  return (
    <div>
      <Grid container>
        <Grid item xs={4}>
          <Typography variant="h6">
            Required input
          </Typography>
          <Typography variant="caption">
            Enter at least one of the following:
          </Typography>
          {metastate.county.length === 0 && 
            metastate.climdiv.length === 0 && 
            metastate.cwa.length === 0 && 
            metastate.basin.length === 0 && 
            metastate.state.length === 0 &&
            metastate.bbox.length === 0 &&
            <RenderTextField
              id="sids"
              fieldlabel="Station ID(s)"
              value={metastate.sids}
              options={{}}
              updateHelpFor={updateHelpFor}
              updateParam={updateParam}
            />
          }
          {metastate.sids.length === 0 &&
            <div>
              <RenderTextField
                id="state"
                fieldlabel="State"
                value={metastate.state}
                options={{}}
                updateHelpFor={updateHelpFor}
                updateParam={updateParam}
              />
              <RenderTextField
                id="county"
                fieldlabel="County"
                value={metastate.county}
                options={{}}
                updateHelpFor={updateHelpFor}
                updateParam={updateParam}
              />
              <RenderTextField
                id="climdiv"
                fieldlabel="Climate Division"
                value={metastate.climdiv}
                options={{}}
                updateHelpFor={updateHelpFor}
                updateParam={updateParam}
              />
              <RenderTextField
                id="cwa"
                fieldlabel="CWA"
                value={metastate.cwa}
                options={{}}
                updateHelpFor={updateHelpFor}
                updateParam={updateParam}
              />
              <RenderTextField
                id="basin"
                fieldlabel="Basin"
                value={metastate.basin}
                options={{}}
                updateHelpFor={updateHelpFor}
                updateParam={updateParam}
              />
              <RenderTextField
                id="bbox"
                fieldlabel="Bounding box"
                value={metastate.bbox}
                options={{}}
                updateHelpFor={updateHelpFor}
                updateParam={updateParam}
              />
            </div>
          }
        </Grid>

        <Grid item xs={4}>
          <Typography variant="h6">
            Optional input
          </Typography>
          <Typography variant="caption">
            Enter any or all of the following:
          </Typography>
          <RenderTextField
            id="meta"
            fieldlabel="Meta options"
            value={metastate.meta}
            options={{style: {width:"95%"}}}
            updateHelpFor={updateHelpFor}
            updateParam={updateParam}
          />
          {(metastate.sids.length === 0 || metastate.meta.includes('valid_daterange')) &&
            <RenderTextField
              id="elems"
              fieldlabel="Elements"
              value={metastate.elems}
              options={{required: metastate.meta.includes('valid_daterange') ? true : false}}
              updateHelpFor={updateHelpFor}
              updateParam={updateParam}
            />
          }
          <RenderTextField
            id="network"
            fieldlabel="Network"
            value={metastate.network}
            options={{}}
            updateHelpFor={updateHelpFor}
            updateParam={updateParam}
          />
          <RenderTextField
            id="output"
            fieldlabel="Output type"
            value={metastate.output}
            options={{disabled: metastate.meta.length && metastate.output === 'json' ? true : false}}
            updateHelpFor={updateHelpFor}
            updateParam={updateParam}
          />

          {metastate.sids.length === 0 &&
            <DateSelection
              sdate={metastate.sdate}
              edate={metastate.edate}
              date={metastate.date}
              updateHelpFor={updateHelpFor}
              updateParam={updateParam}
            />
          }
        </Grid>
      </Grid>
    </div>
  )
}

export default StnMetaInput
